
def maximumHappinessSum(List, k):
        sum = 0
        for i in range(1,k+1):
                val = max(List)
                List.remove(val)
                List = [*map(lambda x: x - 1, List)]

                if val > 0:
                    sum += val
                    print('val',val)
            

        return sum
